import React from 'react';
import { Header } from 'semantic-ui-react'

class Results extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            ingredients: ['ho','hi'],
        };
    }


    render() {
       const ingredients = this.state.ingredients
      return (
          <div>
              <Header as='h3'> Recipes </Header>
              {ingredients.map((i) =>(
                  <p>i</p>
              ))}
          </div>
      )
    }
}


export default Results;
